INSERT INTO `information` VALUES (1,2,'HEADING_TITLE','What\'s New Here?',0,1,'1',1),(2,2,'TEXT_GREETING_PERSONAL','Welcome back! Would you like to see which <a href=\"/products_new.php\"><u>new products</u></a> are available to purchase?',0,2,'1',1),(3,2,'TEXT_GREETING_PERSONAL_RELOGON','If you are not %s, please <a href=\"/login.php\"><u>log yourself in</u></a> with your account information.',0,3,'1',1),(4,2,'TEXT_GREETING_GUEST','Would you like to <a href=\"/login.php\"><u>log yourself in</u></a>? Or would you prefer to <a href=\"/create_account.php\"><u>create an account</u></a>?',0,4,'1',1),(5,2,'TEXT_MAIN','<p><a href=\"http://validator.w3.org/check?uri=referer\"><img src=\"http://www.w3.org/Icons/valid-html401-blue\" border=\"0\" alt=\"Valid HTML 4.01 Transitional\" width=\"88\" height=\"31\"></a><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> <img src=\"http://jigsaw.w3.org/css-validator/images/vcss-blue\" border=\"0\" alt=\"CSS ist valide!\"></a></p>\r\n<p>This is a default text. This can be changed in the admin panel\'s info manager.</p>\r\n<p>Note: This is a demo store. Orders will not be fulfilled!</p>\r\n<p><br></p>\r\n<p><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> </a></p>',0,5,'1',1),(1,2,'HEADING_TITLE','Willkommen im Online-Shop',0,1,'1',2),(2,2,'TEXT_GREETING_PERSONAL','Sch&ouml;n das Sie wieder da sind! M&ouml;chten Sie die <a href=\"/products_new.php\"><u>neuen Produkte</u></a> ansehen?',0,2,'1',2),(3,2,'TEXT_GREETING_PERSONAL_RELOGON','Wenn Sie nicht %s sind, melden Sie sich bitte <a href=\"/login.php\"><u>hier</u></a> mit Ihrem Kundenkonto an.',0,3,'1',2),(4,2,'TEXT_GREETING_GUEST','Bestehende Kunden k&ouml;nnen sich hier <a href=\"/login.php\"><u>einloggen</u></a>. Neukunden bitten wir, bei einer Bestellung ein <a href=\"/create_account.php\"><u>Kundenkonto</u></a> zu er&ouml;ffnen, um jederzeit den Bestellstatus online abrufen zu k&ouml;nnen.',0,4,'1',2),(5,2,'TEXT_MAIN','<p><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"></a></p>\r\n<p><a href=\"http://validator.w3.org/check?uri=referer\"><img src=\"http://www.w3.org/Icons/valid-html401-blue\" border=\"0\" alt=\"Valid HTML 4.01 Transitional\" width=\"88\" height=\"31\"></a><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> <img src=\"http://jigsaw.w3.org/css-validator/images/vcss-blue\" border=\"0\" alt=\"CSS ist valide!\"></a></p>\r\n<p>Diesen Text k&ouml;nnen Sie im Admin unter Info-Manager &auml;ndern.</p>\r\n<p><strong>Achtung:</strong> Dies ist ein Demo Shop! Bestellungen werden nicht ausgeliefert!</p>\r\n<p><br></p>',0,5,'1',2),(1,2,'HEADING_TITLE','A ver que tenemos aqui',0,1,'1',3),(2,2,'TEXT_GREETING_PERSONAL','Bienvenido de nuevo! &iquest;Le gustaria ver que <a href=\"/products_new.php\"><u>nuevos productos</u></a> hay disponibles?',0,2,'1',3),(3,2,'TEXT_GREETING_PERSONAL_RELOGON','Si no es %s, por favor <a href=\"/login.php\"><u>entre aqui</u></a> e introduzca sus datos.',0,3,'1',3),(4,2,'TEXT_GREETING_GUEST','Bienvenido <span class=\"greetUser\">Invitado!</span> &iquest;Le gustaria <a href=\"/login.php\"><u>entrar en su cuenta</u></a> o preferiria <a href=\"/create_account.php\"><u>crear una cuenta nueva</u></a>?',0,4,'1',3),(5,2,'TEXT_MAIN','<p><a href=\"http://validator.w3.org/check?uri=referer\"><img src=\"http://www.w3.org/Icons/valid-html401-blue\" border=\"0\" alt=\"Valid HTML 4.01 Transitional\" width=\"88\" height=\"31\"></a><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> <img src=\"http://jigsaw.w3.org/css-validator/images/vcss-blue\" border=\"0\" alt=\"CSS ist valide!\"></a></p>\r\n<p>Este text se puede cambiar en el info manager de la administracion.</p>\r\n<p>Note: This is a demo store. Orders will not be fulfilled!</p>\r\n<p><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> </a></p>',0,5,'1',3),(1,2,'HEADING_TITLE','Vediamo cose c\'&egrave; qui',0,1,'1',4),(2,2,'TEXT_GREETING_PERSONAL','Bentornato! Vuoi vedere i <a href=\"/products_new.php\"><u>nouvi prodotti</u></a> che sono disponibili?',0,2,'1',4),(3,2,'TEXT_GREETING_PERSONAL_RELOGON','Se tu non sei %s, <a href=\"/login.php\"><u>effettua il log-in</u></a> con i dati del tuo accout.',0,3,'1',4),(4,2,'TEXT_GREETING_GUEST','Benvenuto <span class=\"greetUser\">!</span> Puoi effettuare qui <a href=\"/login.php\"><u>il log-in</u></a>? Oppure puoi creare qui <a href=\"/create_account.php\"><u>un account</u></a>?',0,4,'1',4),(5,2,'TEXT_MAIN','<p><a href=\"http://validator.w3.org/check?uri=referer\"><img src=\"http://www.w3.org/Icons/valid-html401-blue\" border=\"0\" alt=\"Valid HTML 4.01 Transitional\" width=\"88\" height=\"31\"></a><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> <img src=\"http://jigsaw.w3.org/css-validator/images/vcss-blue\" border=\"0\" alt=\"CSS ist valide!\"></a></p>\r\n<p>This is a default text. This can be changed in the admim panel\'s info manager.</p>\r\n<p>Note: This is a demo store. Orders will not be fulfilled!</p>\r\n<p><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> </a></p>',0,5,'1',4),(1,2,'HEADING_TITLE','Voyons ce que nous avons-l&agrave;',0,1,'1',5),(2,2,'TEXT_GREETING_PERSONAL','Bienvenue &agrave; nouveau! Voudriez-vous voir quels <a href=\"/products_new.php\"><u>nouveaux produits</u></a> sont disponibles&nbsp;?',0,2,'1',5),(3,2,'TEXT_GREETING_PERSONAL_RELOGON','Si vous n\'&ecirc;tes pas %s, veuillez <a href=\"/login.php\"><u>vous indentifier</u></a> avec vos param&egrave;tres de compte.',0,3,'1',5),(4,2,'TEXT_GREETING_GUEST','Bienvenue <span class=\"greetUser\">cher visiteur&nbsp;!</span> Voulez-vous <a href=\"/login.php\"><u>vous identifier</u></a>? Ou pr&eacute;f&eacute;rez-vous <a href=\"/create_account.php\"><u>cr&eacute;er un compte</u></a>&nbsp;?',0,4,'1',5),(5,2,'TEXT_MAIN','<p><a href=\"http://validator.w3.org/check?uri=referer\"><img src=\"http://www.w3.org/Icons/valid-html401-blue\" border=\"0\" alt=\"Valid HTML 4.01 Transitional\" width=\"88\" height=\"31\"></a><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> <img src=\"http://jigsaw.w3.org/css-validator/images/vcss-blue\" border=\"0\" alt=\"CSS ist valide!\"></a></p>\r\n<p>Ce text peut ?tre chang? avec le info manager dans l\'administration.</p>\r\n<p>Note: This is a demo store. Orders will not be fulfilled!</p>\r\n<p><a href=\"http://jigsaw.w3.org/css-validator/check/referer\"> </a></p>',0,5,'1',5),(6,1,'Versand','F&uuml;gen Sie hier Ihre Informationen &uuml;ber Liefer- und Versandkosten ein.',0,1,'1',2),(6,1,'Shipping','Put here your Shipping &amp; Returns information.',0,1,'1',1),(6,1,'Livraison','Mettez ici vous informations sur les livraison &amp; retour.',0,1,'1',5),(6,1,'Spedizione','Inserisci qui le tue informazioni sulla spedizione e consegna.',0,1,'1',4),(6,1,'Env?os','Ponga aqui informacion sobre los Envios y Devoluciones',0,1,'1',3),(7,1,'Unsere AGBs','F&uuml;gen Sie hier Ihre allgemeinen Gesch&auml;ftsbedingungen ein. Diesen Text k&ouml;nnen Sie im Admin-Bereich unter <strong>Info-Manager/Infobox</strong> bearbeiten.',0,2,'1',2),(7,1,'Conditions of Use','Put here your Conditions of Use information. This text can be modified in the admin section under <strong>Info Manager/Infobox</strong>.',0,2,'1',1),(7,1,'Conditions d\'utilisation','Mettez ici les informations concernant vos conditions d\'utilisation.',0,2,'1',5),(7,1,'Condizioni per l\'uso','Inserisci qui le condizioni di informazione sull\' uso.',0,2,'1',4),(7,1,'Condiciones de Uso','Ponga aqui sus condiciones de uso.',0,2,'1',3);
