INSERT INTO `products_description` VALUES (1,2,'R/C Buggy HBX W2','<p>Der HBX MAX BUGGY W2 ist ein reinrassiges Hightechger&auml;t. Der Allradantrieb, die Vollfederung des Fahrwerks sowie die extreme Gel&auml;ndeg&auml;ngigkeit werden Piloten JEDEN Alters begeistern.&nbsp;</p><p><strong>Technische Daten:</strong></p><ul><li>Mode: RC Buggy HBX W2</li><li>Ma&szlig;stab: 1:10</li><li>Mottorart: Elektromotor Luftgek&uuml;hlt</li><li>max. Geschwindigkeit: ca.60km/h</li><li>Stromversorgung: 7,2V 1800mAh Ni-Cd Akku</li><li>Karosserie: aus Lexan</li><li>Radstand: ca.260mm</li><li>Abmessungen (LxBxH): 400mm/260mm/180mm</li><li>Gewicht: ca.1380g (fahrbereit)</li><li>Fernbedienung: rechts/links proportional Vorw&auml;rts/R&uuml;ckw&auml;rts</li><li>dosierbare Regelung der Geschwindigkeit</li><li>Frequenz: 27 Mhz auswechselbarer Quarz.</li><li>Durchmesser der R&auml;der: 8,5 cm</li></ul><p><br /><strong>Beschreibung:</strong></p><ul><li>F&auml;hrt bis zu ca. 60 Km/h!</li><li>4x4 Allradantrieb!</li><li>spitzen Beschleunigung</li><li>Einzelradaufh&auml;ngung</li><li>Einzelradfederung</li><li>Ma&szlig;stab 1:10</li><li>luftgek&uuml;hlter starker elktro- Rippenmotor</li><li>Versiegeltes Getriebe</li><li>elektronischer Fahrtenregler</li><li>Servolenkung</li><li>Chassis des Buggys ist &uuml;berwiegen aus Metall hergestellt</li><li>Wechselbares Cover strapazierf&auml;hig aus Polycarbonat</li><li>Luftgef&uuml;llte noppen Gummireifen</li><li>Fahrzeug ist komplett geschraubt und kann komplett auseinander genommen werden (Anleitung liegt auch bei)</li><li>Der Buggy ist fertig montiert und sofort startklar</li><li>Profi Pistolenfernsteuerung mit ca. 200 Metern Reichweite!</li><li>Per Fernsteuerung l&auml;sst sich alles am Buggy einstellen wie kalibrieren der Lenkung usw!</li><li>Starker Akkupack 1800mAh 7,2V</li><li>Schnellladeger&auml;t Ladedauer nur 5 Stunden</li><li>mit dem Ladeger&auml;t k&ouml;nnen sogar wiederaufladbare Akkus &uuml;ber die Fernsteuerung geladen werden (passender Stecker enthalten).</li><li>Rennen mit mehreren Autos durch Frequenzquarz m&ouml;glich.</li><li>Buggy wird in verschiedenen Farben geliefert.</li></ul><p><br /><strong>Lieferumfang:</strong></p><ul><li>RC Buggy HBX W2</li><li>Profi Pistolenfernbedienung proportionalHochleistungs- Akkupack</li><li>Ladeger&auml;t</li><li>Batterien f&uuml;r Fernsteuerung</li><li>Ausf&uuml;hrliches Anleitung mit Bildern</li></ul>','',311,'','R/C Buggy HBX W2','R/C Buggy HBX W2','R/C Buggy HBX W2'),(1,1,'R/C Buggy HBX W2','<p>Der HBX MAX BUGGY W2 ist ein reinrassiges Hightechger&auml;t. Der Allradantrieb, die Vollfederung des Fahrwerks sowie die extreme Gel&auml;ndeg&auml;ngigkeit werden Piloten JEDEN Alters begeistern.&nbsp;</p><p><strong>Technische Daten:</strong></p> <ul><li>Mode: RC Buggy HBX W2</li><li>Ma&szlig;stab: 1:10</li><li>Mottorart: Elektromotor Luftgek&uuml;hlt</li><li>max. Geschwindigkeit: ca.60km/h</li><li>Stromversorgung: 7,2V 1800mAh Ni-Cd Akku</li><li>Karosserie: aus Lexan</li><li>Radstand: ca.260mm</li><li>Abmessungen (LxBxH): 400mm/260mm/180mm</li><li>Gewicht: ca.1380g (fahrbereit)</li><li>Fernbedienung: rechts/links proportional Vorw&auml;rts/R&uuml;ckw&auml;rts</li><li>dosierbare Regelung der Geschwindigkeit</li><li>Frequenz: 27 Mhz auswechselbarer Quarz.</li><li>Durchmesser der R&auml;der: 8,5 cm</li></ul> <p><br /><strong>Beschreibung:</strong></p> <ul><li>F&auml;hrt bis zu ca. 60 Km/h!</li><li>4x4 Allradantrieb!</li><li>spitzen Beschleunigung</li><li>Einzelradaufh&auml;ngung</li><li>Einzelradfederung</li><li>Ma&szlig;stab 1:10</li><li>luftgek&uuml;hlter starker elktro- Rippenmotor</li><li>Versiegeltes Getriebe</li><li>elektronischer Fahrtenregler</li><li>Servolenkung</li><li>Chassis des Buggys ist &uuml;berwiegen aus Metall hergestellt</li><li>Wechselbares Cover strapazierf&auml;hig aus Polycarbonat</li><li>Luftgef&uuml;llte noppen Gummireifen</li><li>Fahrzeug ist komplett geschraubt und kann komplett auseinander genommen werden (Anleitung liegt auch bei)</li><li>De