rnbedienung proportionalHochleistungs- Akkupack</li><li>Ladeger&auml;t</li><li>Batterien f&uuml;r Fernsteuerung</li><li>Ausf&uuml;hrliches Anleitung mit Bildern</li></ul>','',107,'','R/C Buggy HBX W2','R/C Buggy HBX W2','R/C Buggy HBX W2'),(2,2,'Monster Truck BigFoot','<p class=\"\\&quot;bodytext\\&quot;\"><strong>THE BIGGEST BY ZEED! </strong></p> <p class=\"\\&quot;bodytext\\&quot;\">BigFood, der gr&ouml;&szlig;te Monster Truck bei ZEED, damit fahren Sie alles um! </p> <p class=\"\\&quot;bodytext\\&quot;\">Das gro&szlig;e und breite Chassis sorgt mit seinem Design schon von weitem f&uuml;r aufsehen. Die Reifen sind mit den Felgen verklebt und garantieren auf fast jedem Untergrund guten halt. Ob auf feuchtem Gras, im Gel&auml;nde oder auf der Strasse, mit dem BigFood macht es einfach Spa&szlig;! Dank den gro&szlig;en Stossd&auml;mpfern hat der BigFood eine hohe Bodenfreiheit. Dieses Federwerk sorgt zudem f&uuml;r perfekte Gewichtsverteilung, damit der Monster Truck auch weite Spr&uuml;nge &uuml;ber H&uuml;gel oder Rampen ohne weiteres meistert. </p> <p class=\"\\&quot;bodytext\\&quot;\">Dank dem Betrieb eines 23ccm Zweitakt Motors mit herk&ouml;mmlichem Treibstoff ist der Monster Truck wesentlich einfacher im Betrieb und wird zudem als Ready to Run Modell ausgeliefert. Aus der Packung, fertig und los! </p> <p class=\"\\&quot;bodytext\\&quot;\">Das starten beim BigFood ist ein Kinderspiel. Dank dem eingebauten Zugseil, wird der Monster Truck wie ein Rasenm&auml;her gestartet. </p> <p class=\"\\&quot;bodytext\\&quot;\">Das flexible Chassis sorgt bei dem BigFood f&uuml;r extreme Haltbarkeit und Stabilit&auml;t. </p> <p class=\"\\&quot;bodytext\\&quot;\">Die Kombination der voll einstellbaren langen Federwerken und Doppelquerlenker Aufh&auml;ngung, sorgen f&uuml;r optimales Fahrverhalten im Gel&auml;nde wie auch auf der Strasse. Die Stossd&auml;mpfer, welche aus hochfestem Aluminium gefertigt werden, k&ouml;nnen von aussen durch 2 Varianten eingestellt und ge&auml;ndert werden. F&uuml;r ein gleichm&auml;ssiges Arbeiten der Aufh&auml;ngungen auf allen Oberfl&auml;chen sorgen die langen Federn. </p> <p class=\"\\&quot;bodytext\\&quot;\">Eine hochwertige Fernsteuerung, welche f&uuml;r eine grosse Reichweite garantiert, ist selbstverst&auml;ndlich im RTR Pack enthalten. </p> <p class=\"\\&quot;bodytext\\&quot;\">Dank des grossen 23ccm Benzinmotor hat der BigFood eine grosse Leistung zu bieten. Der 1:5 grosse Monster Truck ist durch die grosse Leistung des 23ccm Benzinmotors gleich beweglich wie ein 1:10 Modell. Mit nur einer Tankf&uuml;llung f&auml;hrt der BigFood l&auml;nger als 40 Minuten. Dadurch dass der Monster Truck normalen Treibstoff ben&uuml;tzt, ist dieser auch deutlich g&uuml;nstiger als Modellbaukraftstoff. Der Motor des BigFood verf&uuml;gt &uuml;ber einen Seilzugstarter, einer Treibstoffpumpe und einen Chocke. </p> <p class=\"\\&quot;bodytext\\&quot;\"><strong>Chassis:</strong> </p> <ul><li>L&auml;nge gesamt 700mm </li><li>H&ouml;he 350mm </li><li>Breite: Vorne 490mm / Hinten 510mm </li><li>Spurweite: Vorne 380mm / Hinten 410mm </li><li>Radstand 485mm </li><li>Bodenfreiheit 92mm </li><li>Gewicht 9,9kg </li><li>4mm Aluminiumchassis </li><li>bel&uuml;ftete Doppelscheibenbremse </li><li>Antrieb: geh&auml;rtete Metallzahnr&auml;der mit Schutzabdeckung </li><li>D&auml;mpfer: 2 verschiedene D&auml;mpfungen und einstellbare Federspannung </li><li>Differenzial: 4 Zahn&auml;der im abgedichteten Geh&auml;use </li></ul> <p class=\"\\&quot;bodytext\\&quot;\"><strong>Motor:</strong> </p> <ul><li>2 Takt Benzinmotor </li><li>Luftk&uuml;hlung </li><li>23ccm Hubraum </li><li>Maximale Leistung: 2,2PS </li><li>Treibstoff: Gemisch 25 (Benzin) : 1 (hochwertiges Zweitakt&ouml;l) </li><li>700ccm Treibstofftank </li><li>Seilzugstarter </li></ul> <p class=\"\\&quot;bodytext\\&quot;\"><strong>Fernsteuerung:</strong> </p> <ul><li>2 Kanal FM Fernsteuerung </li><li>Lenkservo: Starkes, wasserdichtes Servo mit 15kg Stellkraft </li><li>Gasservo: Starkes, wasserdichtes Servo mit 6kg Stallkraft </li></ul>','',257,'','Monster Truck BigFoot','Monster Truck BigFoot','Monster Truck BigFoot'),(2,1,'Monster Truck BigFoot','<p class=\"\\&quot;bodytext\\&quot;\"><strong>THE BIGGEST BY ZEED! </strong></p> <p class=\"\\&quot;bodytext\\&quot;\">BigFood, der gr&ouml;&szlig;te Monster Truck bei ZEED, damit fahren Sie alles um! </p> <p class=\"\\&quot;bodytext\\&quot;\">Das gro&szlig;e und breite Chassis sorgt mit seinem Design schon von weitem f&uuml;r aufsehen. Die Reifen sind mit den Felgen verklebt und garantieren auf fast jedem Untergrund guten halt. Ob auf feuchtem Gras, im Gel&auml;nde oder auf der Strasse, mit dem BigFood macht es einfach Spa&szlig;! Dank den gro&szlig;en Stossd&auml;mpfern hat der BigFood eine hohe Bodenfreiheit. Dieses Federwerk sorgt zudem f&uuml;r perfekte Gewichtsverteilung, damit der Monster Truck auch weite Spr&uuml;nge &uuml;ber H&uuml;gel oder Rampen ohne weiteres meistert. </p> <p class=\"\\&quot;bodytext\\&quot;\">Dank dem Betrieb eines 23ccm Zweitakt Motors mit herk&ouml;mmlichem Treibstoff ist der Monster Truck wesentlich einfacher im Betrieb und wird zudem als Ready to Run Modell ausgeliefert. Aus der Packung, fertig und los! </p> <p class=\"\\&quot;bodytext\\&quot;\">Das starten beim BigFood ist ein Kinderspiel. Dank dem eingebauten Zugseil, wird der Monster Truck wie ein Rasenm&auml;her gestartet. </p> <p class=\"\\&quot;bodytext\\&quot;\">Das flexible Chassis sorgt bei dem BigFood f&uuml;r extreme Haltbarkeit und Stabilit&auml;t. </p> <p class=\"\\&quot;bodytext\\&quot;\">Die Kombination der voll einstellbaren langen Federwerken und Doppelquerlenker Aufh&auml;ngung, sorgen f&uuml;r optimales Fahrverhalten im Gel&auml;nde wie auch auf der Strasse. Die Stossd&auml;mpfer, welche aus hochfestem Aluminium gefertigt werden, k&ouml;nnen von aussen durch 2 Varianten eingestellt und ge&auml;ndert werden. F&uuml;r ein gleichm&auml;ssiges Arbeiten der Aufh&auml;ngungen auf allen Oberfl&auml;chen s