li><li>Speicherm&ouml;glichkeit auf Memory Stick Duo</li><li>Anschl&uuml;sse i.LlNK Ein- und Ausgang</li><li>USB</li><li>Komponenten-Ausgang</li><li>Audio/Video- und S-Video-Ausgang</li><li>Abmessungen 71 x 94 x 188 mm</li><li>Gewicht 670 g</li></ul>','',131,'','Sony HDR-HC1','Sony HDR-HC1','Sony HDR-HC1'),(4,1,'Sony HDR-HC1','The Sony Handycam HDR-HC1\'s real draw is its ability to record 1080i HD video on standard MiniDV cassettes; it uses the recently implemented HDV format, which employs MPEG-2 compression rather than DV. Not much software currently supports HDV for digitizing, and the packages that do tend to be expensive products such as Adobe Premiere Pro 1.5 and Apple Final Cut Pro 5.0. So the HC1 also provides HD-to-DV downconversion for editing or playback on a standard-def (SD) TV. Like its big brother, the HDR-FX1, it incorporates Sony\'s Cinematic mode for simulating the appearance of 24fps film. It can also record standard DV. The camcorder supports component-video output and supplies the necessary cables, but if you have a FireWire port on your TV, you\'ll get the best playback quality that way.<br /><br />For the HC1\'s sensor, Sony uses a 1/3-inch, 3-megapixel CMOS chip with an RGB filter array. That provides an effective 2.0 megapixels for HD shooting and stills, 1.5 megapixels for SD video, and 2.8 megapixels for 4:3 photos. Its Zeiss T* 10X zoom lens won\'t win any spec wars, but it\'s perfectly sufficient for most shots, and Sony boosts the zoom effectiveness with its Super SteadyShot electronic stabilization.<br /><br />The rest of the HC1\'s features compete respectably with those of most camcorders in the same price bracket. You can select among automatic, manual, or spot focus. The Expanded Focus button enlarges the center of the scene for easier manual focusing, and the Tele Macro button will defocus the background to bring out the subject. In addition to using automatic adjustment and a handful of exposure presets, you can manually adjust the exposure or select the shutter speed. Same goes for the white balance, which includes a manual color-bias slider within the menu system. A zebra-stripe overexposure display and a live histogram supplement your exposure options, and for low-light shooting, you can turn to Sony\'s infrared NightShot mode and Super NightShot, which uses infrared and the built-in video light. An on-camera flash works for still photography, and Sony\'s Active Interface Shoe allows for more accessories. You can adjust the audio levels manually, and the HC1 includes connectors for an external microphone and headphones.','',262,'','Sony HDR-HC1','Sony HDR-HC1','Sony HDR-HC1'),(4,5,'Sony HDR-HC1','<ul><li>10fach optischer Zoom</li><li>3 Megapixel CMOS-Sensor</li><li>14 bit HD DXP Analog/Digital-Wandler</li><li>2,7 Zoll Hybrid LCD-Monitor</li><li>123.000 Pixel</li><li>Steady Shot Bildstabilisator</li><li>Fotofunktion Fotos mit 1920 x 1440 Pixel</li><li>Speicherm&ouml;glichkeit auf Memory Stick Duo</li><li>Anschl&uuml;sse i.LlNK Ein- und Ausgang</li><li>USB</li><li>Komponenten-Ausgang</li><li>Audio/Video- und S-Video-Ausgang</li><li>Abmessungen 71 x 94 x 188 mm</li><li>Gewicht 670 g</li></ul>','',61,'','Sony HDR-HC1','Sony HDR-HC1','Sony HDR-HC1'),(4,4,'Sony HDR-HC1','<ul><li>10fach optischer Zoom</li><li>3 Megapixel CMOS-Sensor</li><li>14 bit HD DXP Analog/Digital-Wandler</li><li>2,7 Zoll Hybrid LCD-Monitor</li><li>123.000 Pixel</li><li>Steady Shot Bildstabilisator</li><li>Fotofunktion Fotos mit 1920 x 1440 Pixel</li><li>Speicherm&ouml;glichkeit auf Memory Stick Duo</li><li>Anschl&uuml;sse i.LlNK Ein- und Ausgang</li><li>USB</li><li>Komponenten-Ausgang</li><li>Audio/Video- und S-Video-Ausgang</li><li>Abmessungen 71 x 94 x 188 mm</li><li>Gewicht 670 g</li></ul>','',74,'','Sony HDR-HC1','Sony HDR-HC1','Sony HDR-HC1'),(4,3,'Sony HDR-HC1','<ul><li>10fach optischer Zoom</li><li>3 Megapixel CMOS-Sensor</li><li>14 bit HD DXP Analog/Digital-Wandler</li><li>2,7 Zoll Hybrid LCD-Monitor</li><li>123.