ide SVGA11 (1024x600) display with XBRITE&trade; LCD technology, Intel&reg; Core&trade; Solo Ultra Low Voltage CPU for fast processing, and Windows Vista&trade; Business on board. Advanced Wireless capabilities are built right in, and expansion is a breeze with the included port replicator.</p><p><strong>A truly mobile wireless companion.</strong><br />True mobility is about broad access, just as much as it is about slim, lightweight design. And the VAIO&reg; UX Micro PC is taking that access farther than ever before. With integrated wireless Wide Area Network (WAN)13 technology, you can access the Cingular Wireless EDGE network to extend your wireless coverage beyond LAN3 access networks and hotspots. And with integrated wireless LAN3 and Bluetooth&reg; technology5, the VAIO&reg; UX Micro PC gives you the freedom to go farther, do more, and stay connected.</p><p><strong>Communication on the go.</strong><br />The VAIO&reg; UX Micro PC is communications-ready, with integrated camera and built-in microphone and speakers, so you&rsquo;re equipped to communicate via VoIP12 (Voice over Internet Protocol) virtually anywhere WLAN3 or WWAN13 service is available.</p><p><strong>Ingenious design.</strong><br />An integrated keyboard and stylus allow you to choose the input method you prefer. VAIO&reg; Touch Launcher and Instant Command enable quick and easy program access, and the biometric fingerprint sensor stores your passwords so you can access applications and secure web sites without having to type them. And the UX Micro PC really makes smart use of all its display space. With control buttons for zooming, scrolling, and a stick pointer, as well as the ability to view in either landscape or portrait orientations, you know you&rsquo;ll be able to view documents, applications, and media in the most appropriate way.</p>','',230,'','VAIO UX Series Micro PC','VAIO UX Series Micro PC','VAIO UX Series Micro PC'),(6,1,'VAIO UX Series Micro PC','<p>Lightweight heavyweight: The ul